import React from 'react'

export default function NavLogo() {
  return (
    <div className='absolute max-w-screen-xl mx-auto px-4 py-3 flex items-center justify-between'>
        <a class="flex items-center text-xl font-bold text-gray-900 hover:text-blue-500" href="#">
      <img src="/images" alt="Logo" class="mr-2" width="30" height="24"/>
      <span>Bootstrap</span>
    </a>
    </div>
  )
}
